VEJO UM MONTE DE IDIOTAS, COMENTANDO O VIDEO AO QUAL O PRESIDENTE ESTÁ CHORANDO, HOJE NA SOLENIDADE MILITAR PELA MANHÃ. EU DIGO O PORQUE ELE CHORA...

O presidente Bolsonaro, chora porque não se conforma com a atitude desse povo, covarde, arrogante, ignorante e metido a besta, que acha que sabe de tudo mas não sabe de PN;

- ele chora pela falta de conhecimento do seu próprio povo;

- ele chora porque sabe que somente o povo, é capaz de resolver essa situação ao qual estamos;

- ele chora por causa da covardia e acomodação de muitos que preferem estar em casa curtindo um final de semana, tomando sua cervejinha e assando sua carne, enquanto outros estão há mais de 30 dias em frente aos quartéis na angústia, de que algo irá acontecer;

- ele chora porque sabe que o futuro das próximas gerações está comprometido justamente por causa desse povo BURRO, que é o brasileiro;


Porém, ele sabe que o choro pode durar uma noite, mas a alegria vem pela manhã.

Tenham coragem, aumente sua fé, eu confio e acredito no presidente Bolsonaro.
